import React, { useState } from 'react';
import registerimg from "./images/regimg.jpg";
function Register() {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  const [errors, setErrors] = useState({});

  const handleSubmit = (e) => {
    e.preventDefault();
    const newErrors = {};

    if (username === '') {
      newErrors.username = 'Please Enter UserName';
    }

    if (password.length < 6) {
      newErrors.password = 'password must be greater than 6 letters';
    }

    if (password !== confirmPassword) {
      newErrors.confirmPassword = 'please ensure password and confirmpassword are same';
    }

    setErrors(newErrors);

    if (Object.keys(newErrors).length === 0) {
      // Submit the form data
      console.log('Form submitted:', { username, password });
    }
  };
    return (
        <div className="conatiner">
                <div className="row">
                    <div className="col-1">
                    </div>
                    <div className="col-4">
                        <h1>Sign Up</h1>
                        <div class="mb-3">
                            <div class="form-floating">
                                <input type="password" class="form-control" placeholder="Password" />
                                <label>Your Name</label>
                            </div>
                        </div>
                        <div class="mb-3">
                            <div class="form-floating">
                                <input type="password" class="form-control" placeholder="Password" />
                                <label>Your Email</label>
                            </div>
                        </div>
                        <div class="mb-3">
                            <div class="form-floating">
                                <input type="password" class="form-control" placeholder="Password" />
                                <label>password</label>
                            </div>
                        </div>
                        <div class="mb-3">
                            <div class="form-floating">
                                <input type="password" class="form-control" placeholder="Password" />
                                <label>Re-Enter your password</label>
                            </div>
                        </div>
                        <div class="mb-3">
                            <div class="form-check">
                                <input class="form-check-input" type="checkbox" />
                                <label class="form-check-label">I agree all statements in<span className="regtext"> Terms and conditions</span></label>
                            </div>
                        </div>
                        <button className="btn btn-info login-size">REGISTER</button>
                    </div>
                    <div className="col-1">
                    </div>
                    <div className="col-6">
                        <div class="register-img">
                            <img src={registerimg} alt="logo" height="450px" width="100%" />
                        </div>
                        <div id="usercheck" style={{ color: 'red', fontSize: 20, paddingLeft: 100 }}></div>
                        <div id="passwordcheck" style={{ color: 'red', fontSize: 20, paddingLeft: 100 }}></div>
                        <div id="confirmpasswordcheck" style={{ color: 'red', fontSize: 20, paddingLeft: 100 }}></div>
                        <div id="success" style={{ color: 'rgb(81, 255, 0)', fontSize: 20, paddingLeft: 100 }}></div>
                </div>
                </div>
        </div>
    )
}
export default register;
